import './App.css';
import { Component } from 'react';

import TOC from './conponents/Toc'
import Subject from './conponents/Subject'
import Content from './conponents/Content'

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      suject: {title:'state web', sub:'www'}
    }
  }

  render() {
    return (
      <div className="App">
        <Subject title ={ this.state.suject.title } sub = "1.1"/>
        <Subject title ="2" sub = "2.1"/>
        <TOC/>
        <Content title="html" des = "i can do it!"/>
      </div>
    );
  }
}

export default App;
